 550毫克   ——补钙\n<br><br>\nVitamin D3  维生素D3       6.25微克   ——吸收\n<br><br>\nVitamin K2 维生素K2       17.6微克   ——锁钙\n<br><br>\n补钙+吸收+锁钙，三大成分黄金搭档，真正能感受到补钙效果的产品，真正与众不同的钙。\n<br><br>\n【主要特点】：\n<br><br>\n澳洲BIO ISLAND 天然牛乳钙骨保健胶囊中的钙质来源于新西兰纯净的牛乳中提取的天然牛乳钙，可有效的被人体吸收。钙是骨骼发育和维持骨骼、牙齿、肌肉的收缩和神经传递的重要矿物质，在生命的各个阶段都需要钙的补充都尤为重要。在青春期，怀孕期间和哺乳期，妇女绝经后，中老年阶段，需要很大限度地保持稳定的摄入和吸收钙质提高骨骼结构的强度。\n<br><br>\n澳洲BIO ISLAND 天然牛乳钙骨保健胶囊中含有的维生素D3提高促进体内钙的吸收，有效减少因饮食中缺乏钙及钙不能有效吸收所导致骨质疏松。每粒胶囊含有维生素K2将补充和吸收的钙质与人体骨骼中本身含有的钙充分结合提高骨密度，强大支持锁住补充的钙质，避免钙质的流失。 \n<img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000237/pic_2.jpg\"><br><img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000237/pic_3.jpg\"><br>','<h3>我们郑重承诺，为消费者提供最纯正的原装正品。</h3><br>正品采购<br>选择，决定结果！团团网对所有供应商的资质进行严格审核，所有产品均直接向澳洲正规商家，或是品牌授权代理商采购。<br>支付方便<br>团团网提供多种付款方式，包括货到付款方式、在线支付和来店自提，让顾客省心省力又免去后顾之忧。<br>','OZtuantuan是澳洲第一家专注澳洲健康绿色产品的团购网站，通过整合电商平台+移动网络优势将澳洲优质的绿色产品、健康理念带给广大消费者，致力于为广大亚健康人群及追求健康生活品质人士提供健康生活服务。<br><br>\nOZtuantuan自主开发了一套全新的团购销售体系。OZtuantuan与各大品牌代理商合作，整合消费者需求，将高质量、价格及其实惠的绿色产品带给消费者。同时，OZtuantuan为消费者提供了完善的产品咨询、产品配送以及售后服务，确保为广大绿色生活追求者提供价格最优惠、品质最放心的澳洲产品。\n<br><br>\n品质和诚信是企业文化的精髓，也是澳优汇给予每一位消费者和合作者的承诺。为呵护这一份精神，将不断学习和进步，在瞬息万变的互联网浪潮和不断升华的健康理念中始终占据前沿，力求成为绿色电商领域的一面旗帜。','2','2016-07-28 00:00:00','2026-09-12 12:25:00','2016-06-24 10:00:00','Admin','2017-03-06 07:11:47','ADMIN','OZ_TT_AD_GB',NULL,NULL,NULL,NULL,NULL),(511,'GD20160523000238','GD20160523000238','0','0','1','0',12.49,607,62,100,'欢迎来到OZTuanTuan！','产品重量：0.20公斤<br>作为幼儿日常膳食补充，一天一粒。1岁以上即可食用，具有咀嚼能力的儿童直接口服，两岁以下建议可磨成粉拌入稀饭、米粉或其它辅食内，也可直接泡水饮用。一瓶够吃4个月的量，超划算哦！<br><img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000238/pic_1.jpg\"><br>\n<img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000238/pic_2.jpg\"><br><img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000238/pic_3.jpg\"><br><img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD2