提高骨密度，强大支持锁住补充的钙质，避免钙质的流失。 \n<img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000237/pic_2.jpg\"><br><img width=\"100%\" alt=\"\" src=\"https://www.oztuantuan.com.au/wwwfile/GD20160523000237/pic_3.jpg\"><br>','<h3>我们郑重承诺，为消费者提供最纯正的原装正品。</h3><br>正品采购<br>选择，决定结果！团团网对所有供应商的资质进行严格审核，所有产品均直接向澳洲正规商家，或是品牌授权代理商采购。<br>支付方便<br>团团网提供多种付款方式，包括货到付款方式、在线支付和来店自提，让顾客省心省力又免去后顾之忧。<br>','OZtuantuan是澳洲第一家专注澳洲健康绿色产品的团购网站，通过整合电商平台+移动网络优势将澳洲优质的绿色产品、健康理念带给广大消费者，致力于为广大亚健康人群及追求健康生活品质人士提供健康生活服务。<br><br>\nOZtuantuan自主开发了一套全新的团购销售体系。OZtuantuan与各大品牌代理商合作，整合消费者需求，将高质量、价格及其实惠的绿色产品带给消费者。同时，OZtuantuan为消费者提供了完善的产品咨询、产品配送以及售后服务，确保为广大绿色生活追求者提供价格最优惠、品质最放心的澳洲产品。\n<br><br>\n品质和诚信是企业文化的精髓，也是澳优汇给予每一位消费者和合作者的承诺。为呵护这一份精神，将不断学习和进步，在瞬息万变的互联网浪潮和不断升华的健康理念中始终占据前沿，力求成为绿色电商领域的一面旗帜。','2','2016-07-28 20:00:00','2019-04-23 20:00:00','2017-03-06 17:12:16','ADMIN','2017-03-06 07:13:00','ADMIN','OZ_TT_AD_GB','0',NULL,'0','0',1000),(653,'GP20170306000012','GD20160523000243','0','0','1','0',8.50,438,35,200,'','','','','1','2016-08-09 10:00:00','2019-05-05 10:00:00','2017-03-06 07:15:24','ADMIN','2017-03-06 07:15:24','ADMIN','OZ_TT_AD_GL','0',NULL,'0','0',0),(654,'GP20170306000013','GD20170306000003','0','0','1','0',32.00,10,0,10,'','','','','1','2017-03-06 07:30:00','2019-11-30 07:30:00',NULL,NULL,'2017-03-06 07:34:49','ADMIN','OZ_TT_AD_PL',NULL,NULL,'0',NULL,NULL),(655,'GP20170306000014','GD20170306000001','0','0','1','0',22.99,15,0,15,'','','','','1','2017-03-03 07:45:00','2019-11-27 07:45:00',NULL,NULL,'2017-03-06 07:45:35','ADMIN','OZ_TT_AD_PL',NULL,NULL,'0',NULL,NULL),(656,'GP20170306000015','GD20160523000236','1','0','0','1',9.99,210,0,10,'欢迎来到OZTuanTuan！','<h3><u>提货时间：3月7日</u></h3><h3><b><u>保质期：2017年10月</u></b><b><u> </u></b></h3><br>产品重量：0.65公斤<br>Swisse血橙胶原蛋白是Swisse旗下明星产品之一。它并非简单的胶原蛋白补充，而是一种较复杂配方去支持胶原蛋白的产生，含硅和VC，提供头发、皮肤、指甲必需的营养。含血橙萃取精华同样也提供了一种抗氧剂的成分。能保湿、滋养、亮肤、紧肤、防皱、修复、营养皮肤，改善痘痘，调节内分泌。经众多美妞的经验心得，Swisse血橙胶原蛋白液与Swisse叶绿素液搭配服用，号称排毒养颜的Swisse套餐之一。本款商品有新老包装，会随机发货，请大家注意下哦。 <br> <img width=